import style from "./Cards.module.css"
import Card from "../Card/Card";

function Cards(props){
    const {characters} = props
    return(
        <div className={style.container}>
            {
              characters.map((character) =>{
                  <Card character = {character}/>
              })
            }
        </div>
    )
}


export default Cards;
